import { myStore, useSelector } from "./importAll";

export default class Lib{
    public Comp :(props:any)=>JSX.Element;
    public Permissions? : boolean[];
    



    constructor(Comp:(props:any)=>JSX.Element ,permissions?:boolean[]){
        this.Comp = Comp;
        if(permissions)
            this.Permissions = permissions;
    }



    public GetComp(permissions?:IPermissions):(props:any)=>JSX.Element{
        let Com = this.Comp
        
        return (props:any) => {
            let x = myStore.getState().subPage
            if(x == "Guest-Home")
                return  <Com {...props}/>
            else 
                return <>X</>
        }
               
    }


}

interface IPermissions{
    Login :boolean,
    Logout :boolean,
    mainPage : AllMainPagesType,
    subPage : AllSubPagesType;
}
